"use strict";
class Account {
    constructor(id, owner, _amount, _phone) {
        this.id = id;
        this.owner = owner;
        this._amount = _amount;
        this._phone = _phone;
    }
    deposit(amount) {
        if (amount <= 0) {
            console.log(`Please amount greater thAN 100..`);
        }
        this._amount += amount;
    }
    get amount() {
        return this._amount;
    }
    get phone() {
        return this._phone;
    }
    set phone(value) {
        if (value < 0) {
            console.log('Invalid number..');
            return;
        }
        this._phone = value;
    }
}
